import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import Dropzone from "react-dropzone";
import "dropzone/dist/dropzone.css";

const axios = require("axios");

function Dashboard() {
  // const myDropzone = new Dropzone("#my-form");
  // const output = document.querySelector("#output");

  if (document.getElementById("my-form")) {
    var myDropzone = new Dropzone("#my-form", { url: "/file/post" });
    // other code here
  }

  const navigate = useNavigate();

  const [palylistCount, setPalylistCount] = useState();
  const [VideosCount, setVideosCount] = useState();
  useEffect(() => {
    const user_id = sessionStorage.getItem("user_id");
    const token = localStorage.getItem("token");

    axios
      .get(process.env.REACT_APP_API_URL + "/manageplaylist/getAlldata")
      .then((response) => {
        setPalylistCount(response.data.length);
      });
    // Get All Videos Data
    axios
      .get(process.env.REACT_APP_API_URL + "/playlist_video/getAlldata")
      .then((response) => {
        setVideosCount(response.data.length);
      });
  }, []);

  return (
    <>
      <div className="card radius-10 p-5">
        <h4>Image for Home</h4>
        <div className="form-group">
          <label for=""></label>
          <input
            type="file"
            className="form-control-file"
            name=""
            id=""
            placeholder=""
            aria-describedby="fileHelpId"
          />
          <small id="fileHelpId" className="form-text text-muted">
            Help text
          </small>
        </div>
      </div>
      <div className="card radius-10 p-5">
        <h4>Image for Home</h4>
        <div className="form-group">
          <label for=""></label>
          <input
            type="file"
            className="form-control-file"
            name=""
            id=""
            placeholder=""
            aria-describedby="fileHelpId"
          />
          <small id="fileHelpId" className="form-text text-muted">
            Help text
          </small>
        </div>
      </div>
    </>
  );
}

export default Dashboard;
